import React from "react";

const Meetings = () => (
  <section className="bg-white rounded shadow p-4">
    <h2 className="text-xl font-semibold mb-2">Meetings</h2>
    <button className="bg-blue-500 text-white px-3 py-1 rounded mb-2">Schedule Meeting</button>
    <ul>
      <li>Aug 30, 2025 - John Doe</li>
      <li>Sep 2, 2025 - Jane Smith</li>
    </ul>
  </section>
);

export default Meetings;
